import React from "react";
import './ProjectsSection.css';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import SchedulerImage from "../assests/projectImages/calendarGUI.png"

const useStyles = makeStyles({
    root:{
       height: "390px",
        width: "400px",
        backgroundColor:"#131313",
    },
    media:{
        height: "220px",
    },
    cardButton:{
        alignSelf:"center",
    },
    MuiCardActionsRoot:{
        flexDirection: "column",
        backgroundColor: "#4A4949",
    },
});


const ProjectsSection = () => {

    const classes = useStyles();

    return(
        <div className='projects-section-container' id='ProjectsSection'>
            <h1 className='projects-section-header'>Projects</h1>
            <div className='container-divider'/>
            <div className='project-cards-wrapper'>
                <Card className={classes.root}>
                    <CardActionArea>
                        <CardMedia
                            className={classes.media}
                            image={SchedulerImage}
                            title="Image of Scheduler GUI"
                        />
                        <CardContent>
                            <Typography gutterBottom variant="h5" component="h2">
                                Scheduler
                            </Typography>
                            <Typography variant="body2" color="textSecondary" component="p">
                                This is a scheduler made specifically for the Lincoln Medical Center
                            </Typography>
                        </CardContent>
                    </CardActionArea>
                    <CardActions className={classes.MuiCardActionsRoot}>
                        <Button className={classes.cardButton} size="medium" color="primary">
                            Link To Github Repo
                        </Button>
                    </CardActions>
                </Card>
            </div>
        </div>
    );

}

export default ProjectsSection;
